mapper.select:
SELECT 
       "KogakugassanJikofutangakuInfoHoseiTemp".*
FROM   
       "KogakugassanJikofutangakuInfoHoseiTemp" AS "KogakugassanJikofutangakuInfoHoseiTemp"
WHERE  
       "KogakugassanJikofutangakuInfoHoseiTemp"."hihokenshaNo" = #{hihokenshaNo}
       AND "KogakugassanJikofutangakuInfoHoseiTemp"."taishoNendo" = #{taishoNendo}
       AND "KogakugassanJikofutangakuInfoHoseiTemp"."hokenshaNo" = #{hokenshaNo}
       AND "KogakugassanJikofutangakuInfoHoseiTemp"."shikyuShinseishoSeiriNo" = #{shikyuShinseishoSeiriNo}
       AND "KogakugassanJikofutangakuInfoHoseiTemp"."rirekiNo2" = #{rirekiNo}

SELECT "KogakugassanJikofutangakuInfoHoseiTemp".*,
FROM "KogakugassanJikofutangakuInfoHoseiTemp" AS "KogakugassanJikofutangakuInfoHoseiTemp" LEFT JOIN ( SELECT * FROM rgdb."DbT3071KogakuGassanJikoFutanGakuMeisai" WHERE rgdb."DbT3071KogakuGassanJikoFutanGakuMeisai"."isDeleted" = false )AS "DbT3071KogakuGassanJikoFutanGakuMeisai" ON "DbT3071KogakuGassanJikoFutanGakuMeisai"."hihokenshaNo" = "KogakugassanJikofutangakuInfoHoseiTemp"."hihokenshaNo" AND "DbT3071KogakuGassanJikoFutanGakuMeisai"."taishoNendo" = "KogakugassanJikofutangakuInfoHoseiTemp"."taishoNendo" AND "DbT3071KogakuGassanJikoFutanGakuMeisai"."hokenshaNo" = "KogakugassanJikofutangakuInfoHoseiTemp"."hokenshaNo" AND "DbT3071KogakuGassanJikoFutanGakuMeisai"."shikyuShinseishoSeiriNo" = "KogakugassanJikofutangakuInfoHoseiTemp"."shikyuShinseishoSeiriNo" AND "DbT3071KogakuGassanJikoFutanGakuMeisai"."rirekiNo" = "KogakugassanJikofutangakuInfoHoseiTemp"."rirekiNo2" WHERE "DbT3071KogakuGassanJikoFutanGakuMeisai"."isDeleted" = false
ORDER BY ${改頁出力順}
